//import logo from './images/logo.png';
//import backgroundimg from './images/backgroungimg.jpg'
//import c2 from './images/c2.jpeg'
//import homeimg from './images/homeimg.png';
import './App.css';
import Homepg from './components/Homepg';
import Navbar from './components/Navbar';
import About from './components/About';
import FAQ from './components/FAQ';
import Footer from './components/Footer';
import Membersblock from './components/Membersblock';
function App() {
  return (
    <div className="App">
    <img style={{opacity:0.6,width:1263}} src='./images/c11.jpg' alt=""/>
      <div className='name'>
      <img style={{
        position:'absolute',
        top:1,
        height:150,
        width:150
      }} src='./images/logo2.png' alt=""/>
      <ul className='Institutename'>
<li ><b>Indian Institute Of</b></li>
<li><b>Technology Indore</b></li>
      </ul>
      <div class="button-container">
  <div class="cloud">
    <p >Book an appointment and talk with your counsellor now!</p>
  </div>
  <button class="book-now-button">Book Now</button>
</div>

      <p style={{position:'absolute',left:450,top:50,padding:0,fontSize:55,fontWeight:500}}>Counselling Services</p>
      </div>
      <Navbar/>
      <Homepg/>
      <div className='AboutUs'>
    <p style={{textAlign:'center',fontSize:50}}>About Us</p>
    <p style={{paddingTop:60,paddingBottom:30}}>If you have any concern related to academics or something social, psychological ,you are free to reach out to us.
Counsellor, through the counselling process, listens to a student’s concerns with empathy and responds in a non judgemental way. The process is confidential except in a condition where disclosure is necessary to protects the student, another person or abide by the institute’s policy.</p> 
<p>Some of the common concerns of the young people today are-</p>
<ul style={{paddingBlock:30}}>
<li>1. Loneliness and homesickness</li>
<li>2. Adjustment difficulties</li>
<li>3. Peer pressure</li>
<li>4. Relationship issues</li>
<li>5. Family Problems</li>
<li>6. Procrastination</li>
<li>7. Cyber bullying</li>
<li>8. Behavioural problems (anger outbursts, disobedience, lying etc)</li>
<li>9. Low confidence and self esteem</li>
<li>10. Suicidal thoughts</li>
<li>11. Depression ,anxiety and other mental health problems</li>
<li>12. Substance abuse</li>
</ul>
</div>
      {/* <About/> */}
<Membersblock/>
      <FAQ/>
      <Footer/>
    </div>
  );
}

export default App;
